import styled from "styled-components";

export const Container=styled.div`
background: #C4C4C4;
width: 100%;
height: 700px;
`
//    ************************************navbar ***************************
export const Navbars=styled.div`
padding: 30px 0px;
`
export const Nav=styled.div`
display: flex;
justify-content: space-between;
align-items: center;
flex-direction: row;
`
export const NavBrand=styled.div`
display: flex;
`
export const NavText=styled.div`
font-family: Poppins;
font-style: normal;
font-weight: 600;
font-size: 22px;
line-height: 33px;
color: rgba(255, 255, 255, 0.9);

`
export const NavImg=styled.div`
width: 38px;
height: 38px;
background: #FF6E30;
border-radius: 8px;
margin-right: 10px;
`
export const NavLink=styled.div`
width: 431px;
display: flex;
flex-direction: row;
justify-content: space-between;
align-items: center;
`
export const Link=styled.div`
font-family: Poppins;
font-style: normal;
font-weight: 500;
font-size: 16px;
line-height: 24px;
color: rgba(255, 255, 255, 0.55);
cursor: pointer;
`
//***************************************loginin****************************
export const Loginin=styled.div`
display: flex;
`

export const Signin=styled.div`
font-family: Poppins;
font-style: normal;
font-weight: 600;
font-size: 16px;
line-height: 24px;
color: rgba(255, 255, 255, 0.78);
opacity: 0.78;
width: 118px;
height: 48px;
background: black;
border-radius: 8px;
display: flex;
align-items: center;
justify-content: center;
cursor: pointer;
z-index:1;
&:hover{
    background: #FF6E30;
    color: white;
}
`
export const Signup=styled.div`
width: 118px;
cursor: pointer;
height: 48px;
background: #FF6E30;
border-radius: 8px;
display: flex;
align-items: center;
justify-content: center;
font-family: Poppins;
font-style: normal;
font-weight: 600;
font-size: 16px;
line-height: 24px;
color: #FDF5FF;
margin-left: 5px;
`
